import React from "react";
import { Link } from "react-router-dom";

function RenderCurrentColor(props) {
    const { color } = useParams();
    const hex = colors[color];
    return <Color {...props} hex={hex} color={color} />;
  };

function Color({color, hex}) {    


    // if(!hex) {
