    // }


    return (
        <div className="Color" style={{ backgroundColor: hex}}>
            <div>
            <p>this is {color}.</p>
            <p>How beautiful!</p>
            <p>
                <Link to="/">Return to Color Selector</Link>
            </p>
            </div>
        </div>
    );
}

export default Color;
